                    <p>Pablo é um homem de 53 anos, pai de duas garotas - sua esposa perdeu o emprego ano passado devido a uma doença. Ele admitiu que eles estavam passando por apertos financeiros e essa oportunidade de investimento poderia ser a resposta.</p>
