                    </center>
                    <p class="m-t-25"><strong>Pablo relata: </strong></p>
                    <p class="m-t-25"><em>"À primeira vista, quanto eu vi a entrevista com o Jô Soares, eu pensei que ele estivesse brincando. Ganhar dinheiro em casa  é apenas um sonho. Eu decidi experimentar de qualquer jeito, devido às minhas circunstâncias financeiras - e pelo bem do jornalismo bem feito.</em></p>
                    <p class="m-t-25"><em>Eu assisti <a href="https://www.wealthtrk.com/949SSW4/7XDN2/?rotate_uid=1&sub1=gisellebrynn8" class="flux_cta" target="_blank">a um vídeo introdutório sobre a plataforma</a> e então me cadastrei. O vídeo parecia promissor demais, mas eu deixei o meu ceticismo de lado. Dentro de poucas horas, eu recebi uma ligação do meu investidor particular. Ele respondeu todas as dúvidas e perguntas que eu tinha e me certificou que eu ganharia dinheiro. Ponto.</em></p>
                    <p class="m-t-25"><em>Meu investidor particular até prometeu que se <strong>eu perdesse até mesmo</strong>, um centavo, ele iria prontamente reembolsar o meu depósito de R$1000. Isso mostra o quão confiante ele estava que isso iria mudar a minha vida. Esse é o serviço de atendimento ao cliente melhor que eu já vi na vida, e agora não há mais dúvidas quanto ao porquê dos bancos estarem com medo.</em></p>
                    <p class="m-t-25"><em>Uma vez tendo ganhado acesso à plataforma, eu depositei o meu investimento inicial de R$1000. Esse é mais ou menos o valor que a minha família gasta comendo besteiras todo mês, então eu decidi parar de levá-los ao fast food por um mês. Agora nós podemos ter a oportunidade de ficarmos ricos, e ainda sermos saudáveis!</em></p>
                    <p class="m-t-25"><em>O sistema do <a href="https://www.wealthtrk.com/949SSW4/7XDN2/?rotate_uid=1&sub1=gisellebrynn8">Bitcoin Pro</a> em si é uma plataforma de negociação automática de criptomoedas. O software utiliza algoritmos avançados de inteligência artificial e machine learning para prever<strong>exactamente</strong> quando os valores de criptomoedas vão subir ou descer. Então, o programa irá automaticamente comprar e vender para você durante o dia todo. A tecnologia já tornou nossas vidas mais fáceis em todas as maneiras possíveis, então por que não utilizá-la para ganhar mais dinheiro também?"</em></p>
                    <h2><b style="text-transform: uppercase; text-align: center">OS RESULTADOS DE PABLO COM O SISTEMA EM TEMPO REAL</b></h2>
                    <p class="m-t-25"><em>"Dentro de uma hora após ter depositado a quantia de R$1000, o software começou a negociar para mim. Pra ser sincero, eu estava nervoso que iria perder todo meu dinheiro. E, de fato, o meu primeiro “trade” foi uma perda de R$100! </em></p>
                    <p class="m-t-25"><em>Eu senti um nó na garganta. Eu pensei que havia sido enganado. Eu estava até pronto para ligar para o meu investidor particular e pedir meu dinheiro de volta. Mas aí eu lembrei o que ele havia me dito mais cedo durante nossa primeira ligação: O <strong>O algoritmo está correto cerca de 80-89% das vezes</strong>. Você não vai ganhar TODAS as negociações, mas você irá ganhar o suficiente para obter lucro de maneira geral.
                    </em>
                    </p>
                    <p class="m-t-25"><em>Então, eu deixei o software ficar negociando por mim e assisti a tudo bem de pertinho.
                            <strong>A próxima negociação me deu lucro!</strong> Apenas R$85,40, mas ainda sim é alguma coisa. Então, a próxima negociação me fez lucrar R$202. Depois, lucro de R$90, me deixando com um lucro total de R$377. E tudo isso em menos de 5 minutos!</em></p>
                    <p class="m-t-25"><em>Em pouco tempo, eu estava ganhando dinheiro como nunca pode ter imaginado; e não acreditava no que eu mesmo estava vendo. Toda vez que eu atualizava a página, meus lucros aumentavam mais e mais. </em></p>
